    <>
      <HomeComponent
        handleNewEntry={handleNewEntry}
      />
      {isOpen && (
        <Modal
          title={label.ADD_IDEAS_CHALLENGES}
          onClose={onClose}
          onSave={onSave}
        >
          <div className="w-100">

          </div>
        </Modal>
      )}
    </>
  );
};

export default Home;
